@capsule_house Create -&gt; ship -&gt; get feedback from your community -&gt; *iterate based on feedback within 24 hours* -&gt; repeat.

Any other NFT project does that?

Bravo, @capsule_house!

@GanjaIfTheGrey @Greekdx @capsule_house Pretty sure it had its zodiac unminted.
So they bought it, minted the zodiac, sold it for &gt;1E, and relisted your capsule at a loss.

Still not very smart to list lower during the bull.
